import React, { useState } from "react";

export const ListData = (props) => {
 

  

  return (
    <div key={props.key} className="bg-white rounded-lg shadow-lg rounded-md h-[50rem] w-[80rem]">
      <img src={`https://image.tmdb.org/t/p/w500${props.posterPath}`} alt={props.title} className="w-full h-full object-cover rounded-lg" />
      <div className="p-4">
        <h2 className="text-xl font-semibold mb-2">{props.title}</h2>
      </div>
    </div>
  );
};
